Setting up your Inngest app
Serving Inngest functions
./api/inngest.ts
Copy Copied
```
// All serve handlers have the same arguments:
serve ({
client : inngest , // a client created with new Inngest()
functions : [fnA , fnB] , // an array of Inngest functions to serve, created with inngest.createFunction()
/* Optional extra configuration */
});
```

Setting up your Inngest app
Supported frameworks and platforms
index.ts
Copy Copied
```
import { serve } from "inngest/bun" ;
import { functions , inngest } from "./inngest" ;

Bun .serve ({
port : 3000 ,
routes : {
// ...other routes...
"/api/inngest" : (request : Request ) => {
return serve ({ client : inngest , functions })(request);
} ,
} ,
});
```
See the
[Bun example](https://github.com/inngest/inngest-js/tree/main/examples/bun)
for more information.

Setting up your Inngest app
Supported frameworks and platforms
Framework: Cloudflare Workers v3.19.15+
You can export
```
"inngest/cloudflare"
```
's
```
serve()
```
as your Cloudflare Worker:
Copy Copied
```
import { serve } from "inngest/cloudflare" ;
import { inngest } from "./client" ;
import fnA from "./fnA" ;

export default {
fetch : serve ({
client : inngest ,
functions : [fnA] ,
// We suggest explicitly defining the path to serve Inngest functions
servePath : "/api/inngest" ,
}) ,
};
```
To automatically pass environment variables defined with Wrangler to Inngest function handlers, use the
[Cloudflare Workers bindings middleware](\docs\examples\middleware\cloudflare-workers-environment-variables)
.

Setting up your Inngest app
Supported frameworks and platforms
Framework: DigitalOcean Functions
The DigitalOcean serve function allows you to deploy Inngest to DigitalOcean serverless functions.
Because DigitalOcean does not provide the request URL in its function arguments, you
**must**
include
the function URL and path when configuring your handler:
v3 v2
Copy Copied
```
import { serve } from "inngest/digitalocean" ;
import { inngest } from "./src/inngest/client" ;
import fnA from "./src/inngest/fnA" ; // Your own function

const main = serve ({
client : inngest ,
functions : [fnA] ,
// Your digitalocean hostname.  This is required otherwise your functions won't work.
serveHost : "https://faas-sfo3-your-url.doserverless.co" ,
// And your DO path, also required.
servePath : "/api/v1/web/fn-your-uuid/inngest" ,
});

// IMPORTANT: Makes the function available as a module in the project.
// This is required for any functions that require external dependencies.
module . exports .main = main;
```
Inngest functions can also be deployed to
[DigitalOcean's App Platform or Droplets](\docs\deploy\digital-ocean)
.

Setting up your Inngest app
Supported frameworks and platforms
src/index.ts
Copy Copied
```
import { Elysia } from "elysia" ;
import { serve } from "inngest/bun" ;
import { functions , inngest } from "./inngest" ;

const handler = serve ({
client : inngest ,
functions ,
});

const inngestHandler = new Elysia () .all ( "/api/inngest" , ({ request }) =>
handler (request)
);

// register the handler with Elysia
const app = new Elysia ()
.use (inngestHandler)
```
Elysia's
```
use
```
function expects a single argument. We make use of the
```
all
```
method for the inngest api route to handle the expected
methods and then get the request off of the context object passed to elysia handlers.
See the
[ElysiaJS](https://github.com/inngest/inngest-js/tree/main/examples/framework-elysiajs)
[example](https://github.com/inngest/inngest-js/tree/main/examples/framework-elysiajs)
for more information.

Setting up your Inngest app
Supported frameworks and platforms
Framework: Fastify v2.6.0+
You can serve Inngest functions within your existing Fastify app.
We recommend using the exported
```
inngestFastify
```
plugin, though we also expose a generic
```
serve()
```
function if you'd like to manually create a route.
Plugin Custom route (v3) Custom route (v2)
Copy Copied
```
import Fastify from "fastify" ;
import { fastifyPlugin } from "inngest/fastify" ;
import { inngest , fnA } from "./inngest" ;

const fastify = Fastify ();

fastify .register (fastifyPlugin , {
client : inngest ,
functions : [fnA] ,
options : {} ,
});

fastify .listen ({ port : 3000 } , function (err , address) {
if (err) {
fastify . log .error (err);
process .exit ( 1 );
}
});
```
See the
[Fastify example](https://github.com/inngest/inngest-js/tree/main/examples/framework-fastify)
for more information.

Setting up your Inngest app
Supported frameworks and platforms
index.js
v3 v2
Copy Copied
```
import { createApp , eventHandler , toNodeListener } from "h3" ;
import { serve } from "inngest/h3" ;
import { createServer } from "node:http" ;
import { inngest } from "./inngest/client" ;
import fnA from "./inngest/fnA" ;

const app = createApp ();
app .use (
"/api/inngest" ,
eventHandler (
serve ({
client : inngest ,
functions : [fnA] ,
})
)
);

createServer ( toNodeListener (app)) .listen ( process . env . PORT || 3000 );
```
See the
[github.com/unjs/h3](https://github.com/unjs/h3)
repository for more information about how to host an H3 endpoint.

Setting up your Inngest app
Supported frameworks and platforms
Framework: Koa v3.6.0+
Add the following to your routing file:
Copy Copied
```
import { serve } from "inngest/koa" ;
import Koa from "koa" ;
import bodyParser from "koa-bodyparser" ;
import { functions , inngest } from "./inngest" ;

const app = new Koa ();
app .use ( bodyParser ()); // make sure we're parsing incoming JSON

const handler = serve ({
client : inngest ,
functions ,
});

app .use ((ctx) => {
if ( ctx . request .path === "/api/inngest" ) {
return handler (ctx);
}
});
```
See the
[Koa example](https://github.com/inngest/inngest-js/tree/main/examples/framework-koa)
for more information.

Setting up your Inngest app
Supported frameworks and platforms
Framework: NestJS
Add the following to
```
./src/main.ts
```
:
Copy Copied
```
import { Logger } from '@nestjs/common' ;
import { NestFactory } from '@nestjs/core' ;
import { NestExpressApplication } from '@nestjs/platform-express' ;
import { serve } from 'inngest/express' ;

import { inngest } from '@modules/common/inngest/client' ;
import { getInngestFunctions } from '@modules/common/inngest/functions' ;

import { AppModule } from './app.module' ;
import { AppService } from './app.service' ;

async function bootstrap () {
const app = await NestFactory .create < NestExpressApplication >(AppModule , {
bodyParser : true ,
});

// Setup inngest
app .useBodyParser ( 'json' , { limit : '10mb' });

// Inject Dependencies into inngest functions

const logger = app .get (Logger);
const appService = app .get (AppService);

// Pass dependencies into this function
const inngestFunctions = getInngestFunctions ({
appService ,
logger ,
});

// Register inngest endpoint
app .use (
'/api/inngest' ,
serve ({
client : inngest ,
functions : inngestFunctions ,
}) ,
);

// Start listening for http requests
await app .listen ( 3000 );
}

bootstrap ();
```
See the
[NestJS example](https://github.com/inngest/inngest-js/tree/main/examples/framework-nestjs)
for more information.

Setting up your Inngest app
Supported frameworks and platforms
Framework: Nitro v3.24.0
Add the following to
```
./server/routes/api/inngest.ts
```
