import { serve } from "inngest/nitro" ;
import { inngest } from "~~/inngest/client" ;
import fnA from "~~/inngest/fnA" ; // Your own function

export default eventHandler (
serve ({
client : inngest ,
functions : [fnA] ,
})
);
```
