Setting up your Inngest app
Supported frameworks and platforms
Framework: Remix
Add the following to
```
./app/routes/api.inngest.ts
```
:
v3 v2
Copy Copied
```
// app/routes/api.inngest.ts
import { serve } from "inngest/remix" ;
import { inngest } from "~/inngest/client" ;
import fnA from "~/inngest/fnA" ;

const handler = serve ({
client : inngest ,
functions : [fnA] ,
});

export { handler as action , handler as loader };
```
See the
[Remix example](https://github.com/inngest/inngest-js/tree/main/examples/framework-remix)
for more information.

Setting up your Inngest app
Supported frameworks and platforms
Framework: SvelteKit v3.5.0+
Add the following to
```
./src/routes/api/inngest/+server.ts
```
:
Copy Copied
```
import { functions , inngest } from '$lib/inngest' ;
import { serve } from 'inngest/sveltekit' ;

const inngestServe = serve ({ client : inngest , functions });
export const GET = inngestServe . GET ;
export const POST = inngestServe . POST ;
export const PUT = inngestServe . PUT ;
```
See the
[SvelteKit example](https://github.com/inngest/inngest-js/tree/main/examples/framework-sveltekit)
for more information.

Setting up your Inngest app
Supported frameworks and platforms
Custom frameworks
If the framework that your application uses is not included in the above list of first-party supported frameworks, you can create a custom
```
serve
```
handler.
To create your own handler, check out the
[example handler](https://github.com/inngest/inngest-js/blob/main/packages/inngest/src/test/functions/handler.ts)
in our SDK's open source repository to understand how it works. Here's an example of a custom handler being created and used:
Copy Copied
```
import { Inngest , InngestCommHandler , type ServeHandlerOptions } from "inngest" ;

const serve = (options : ServeHandlerOptions ) => {
const handler = new InngestCommHandler ({
frameworkName : "edge" ,
fetch : fetch .bind (globalThis) ,
... options ,
handler : (req : Request ) => {
return {
body : () => req .json () ,
headers : (key) => req . headers .get (key) ,
method : () => req .method ,
url : () => new URL ( req .url , `https:// ${ req . headers .get ( "host" ) || "" } ` ) ,
transformResponse : ({ body , status , headers }) => {
return new Response (body , { status , headers });
} ,
};
} ,
});

return handler .createHandler ();
};

const inngest = new Inngest ({ id : "example-edge-app" });

const fn = inngest .createFunction (
{ id : "hello-world" } ,
{ event : "test/hello.world" } ,
() => "Hello, World!"
);

export default serve ({ client : inngest , functions : [fn] });
```
